description:
Tag Team Match-Up: Did you Miss Me? Princess Donna Saves the Day!!


Sep 18, 2012 - Performers: Mistress Kara, Katie Summers, Izamar Gutierrez and Bryn Blayne



MP4 and WMV + Pics.        

After a rough round 1 with Katie Summers getting trapped on the mat for the entire 12 minutes she got worn out and wasn't able to continue shooting. Instead of canceling the show Princess Donna jumps in out of many years of retirement to keep the match going! Princess Donna is stronger than she looks, but way out of practice. Can she hold her own on the mat? Watch and find out!

